A △ B = {5, 7, 11, 6, 8, 10}

Now, let's find the complement of A, denoted as Ac. The complement of A is the set of all elements that are not in A. Since we are not given a universal set, we cannot find the exact elements in Ac. However, we can still analyze the given expressions.

Let's find (A △ B) ∩ Ac. This is the intersection of the symmetric difference of A and B with the complement of A. Since the elements in the symmetric difference are either in A or B but not both, the elements from A in the symmetric difference will not be in Ac. Therefore, (A △ B) ∩ Ac will only contain the elements from B that are not in A.

(A △ B) ∩ Ac = {6, 8, 10}

Now, let's find (A ∩ Ac) △ (B ∩ Ac). The intersection of A and Ac is an empty set, as there are no elements that are both in A and not in A.

A ∩ Ac = {}

Now, let's find the intersection of B and Ac. This will be the set of elements that are in B and not in A.

B ∩ Ac = {6, 8, 10}

Now, let's find the symmetric difference of the empty set and the intersection of B and Ac.

{} △ {6, 8, 10} = {6, 8, 10}

Comparing the two expressions, we have:

(A △ B) ∩ Ac = {6, 8, 10}
(A ∩ Ac) △ (B ∩ Ac) = {6, 8, 10}

